import React,{props} from 'react';
import './sass/css/catalog.css';
import catalogData from './catalogData';
export default function Catalogbtn() {
    return (
        <div className="catalog-btn">
            {catalogData.map((obj,index)=>{
            return (
                <div 
                
                className={`${this.props.tabIndex===index+1? "catalog-btn-item active":"catalog-btn-item"}`} key={obj.id} >
                    <b>{obj.title}</b>
                </div>
            )
        })}
        </div>
    )
}
